import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Alert, TextInput, ScrollView } from 'react-native';
import { useCart } from '../context/CartContext';
import { useAuth } from '../context/AuthContext';

export const CheckoutScreen: React.FC<{ navigation: any }> = ({ navigation }) => {
  const { cartItems, getCartTotal, clearCart, placeOrder } = useCart();
  const { user } = useAuth();
  const [deliveryAddress, setDeliveryAddress] = useState(user?.address || '');
  const [selectedCard, setSelectedCard] = useState(user?.cardNumber || '');
  const [cardExpiry, setCardExpiry] = useState(user?.cardExpiry || '');
  const [cardCVV, setCardCVV] = useState(user?.cardCVV || '');
  const [isProcessing, setIsProcessing] = useState(false);

  const processPayment = async () => {
    // Mock payment processing
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve({ success: true, transactionId: Date.now().toString() });
      }, 2000);
    });
  };

  const handlePlaceOrder = async () => {
    if (!user) {
      Alert.alert('Error', 'Please login to place order');
      return;
    }

    if (!deliveryAddress || !selectedCard || !cardExpiry || !cardCVV) {
      Alert.alert('Error', 'Please fill in all delivery and payment details');
      return;
    }

    setIsProcessing(true);

    try {
      // Process payment
      const paymentResult = await processPayment();

      if (paymentResult.success) {
        // Create order with updated details
        const orderData = {
          ...user,
          address: deliveryAddress,
          cardNumber: selectedCard,
          cardExpiry,
          cardCVV
        };

        const orderId = await placeOrder(orderData);

        Alert.alert('Order Placed Successfully!', 
          `Order #${orderId}\nTotal: R${getCartTotal().toFixed(2)}\nDelivery to: ${deliveryAddress}`, [
          { text: 'OK', onPress: () => {
            clearCart();
            navigation.navigate('Menu');
          }}
        ]);
      } else {
        Alert.alert('Payment Failed', 'Please check your card details and try again.');
      }
    } catch (error) {
      Alert.alert('Error', 'Failed to place order. Please try again.');
    } finally {
      setIsProcessing(false);
    }
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Order Summary</Text>

      {cartItems.map(item => (
        <View key={item.id} style={styles.orderItem}>
          <Text style={styles.itemName}>{item.menuItem.name}</Text>
          <Text style={styles.itemDetails}>
            R{item.menuItem.price} x {item.quantity} = R{(item.menuItem.price * item.quantity).toFixed(2)}
          </Text>
        </View>
      ))}

      <View style={styles.totalContainer}>
        <Text style={styles.total}>Total: R{getCartTotal().toFixed(2)}</Text>
      </View>

      <TouchableOpacity style={styles.placeOrderButton} onPress={handlePlaceOrder}>
        <Text style={styles.placeOrderButtonText}>Place Order</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, padding: 20, backgroundColor: 'white' },
  title: { fontSize: 24, fontWeight: 'bold', textAlign: 'center', marginBottom: 30 },
  orderItem: { flexDirection: 'row', justifyContent: 'space-between', paddingVertical: 10, borderBottomWidth: 1, borderBottomColor: '#eee' },
  itemName: { fontSize: 16, fontWeight: 'bold' },
  itemDetails: { fontSize: 14, color: '#666' },
  totalContainer: { marginTop: 20, paddingTop: 20, borderTopWidth: 2, borderTopColor: '#007bff' },
  total: { fontSize: 20, fontWeight: 'bold', textAlign: 'center' },
  placeOrderButton: { backgroundColor: '#28a745', padding: 15, borderRadius: 8, marginTop: 30 },
  placeOrderButtonText: { color: 'white', textAlign: 'center', fontSize: 16, fontWeight: 'bold' }
});
